import React from 'react'


const Navbar = () => {
  const emp_id = JSON.parse(window.sessionStorage.getItem('emp_id'));
    const handleLogout=()=>{
        sessionStorage.clear();
        window.location.reload(true);
    }
  return (
    <div>
        <nav class="navbar navbar-dark bg-dark ">
        <img src='https://www.iiitb.ac.in/includefiles/userfiles/images/IIITB%20Silver%20Jubilee%20Logo.jpg' width="30" height="30" class="d-inline-block align-top" alt=""></img>
            <button type="click" onClick={handleLogout} class ="btn btn-secondary btn-lg">Logout</button>
            <p class="User">
              Hi,{emp_id.employeeName} !!
              </p>
        </nav>
    </div>
  )
}

export default Navbar
